export default (function(a,b,c,d,e,f,g,h,i,j){return {data:{rbMycPrrDZ:{data:{id:652,attributes:{imdbId:"tt0083741",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNjc1MDE5YWMtODUyZi00YjQxLWE0ZWMtOGMyZWFjMjk1ZGE4XkEyXkFqcGdeQXVyNzc5MjA3OA@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"5.8\u002F10"}],item_lang:{data:{id:1315,attributes:{title:b,plot:"Based on the novel Winterkill, by William Judson, Cold River is the story of an Adirondack guide who takes his young daughter and step-son on a long camping trip in the fall of 1932. When winter strikes unexpectedly early (a natural phenomenon known as a 'winterkill' - so named because the animals are totally unprepared for a sudden, early winter, and many freeze or starve to death), a disastrous turn of events leaves the two children to find their own way home without food, or protection from the elements. Rated PG for mild violence and language.",slug:"cold-river"}}},books:{data:[{id:4419,attributes:{title:b,description:e,thumbnail:f,authors:[c],firstBook:true,published:g,publisher:h,subtitle:a}},{id:4420,attributes:{title:b,description:e,thumbnail:f,authors:[c],firstBook:d,published:g,publisher:h,subtitle:a}},{id:4421,attributes:{title:b,description:"A survival story featuring young people attempting to make their way down a dangerous river.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=TGTGArYWVKcC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:i,publisher:"Signet Book",subtitle:j}},{id:4422,attributes:{title:"Kilman's Landing",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=a-MLAQAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:i,publisher:a,subtitle:j}},{id:4423,attributes:{title:"Judson Moss Bemis, Pioneer",description:"Judson Moss Bemis (1833-1921) was a descendant of Joseph Bemis (b. 1619), who immigrated from England to Concord, Massachusetts in 1640. He married Alice Cogswell (1845- ) in 1866 and they moved to Fitchburg, Massachusetts and later to Rock River, Illinois. Descendants lived in Minnesota, Tennessee, Colorado and elsewhere.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Flw3AAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["William Crowell Edgar"],firstBook:d,published:"1926-01-01",publisher:a,subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940944935}}("","Cold River","William Judson",null,"Two children struggle to survive alone in the Adirondack mountains in this riveting story for “adventure lovers of all ages”(Columbus Dispatch). “What I want to tell you is about Timothy and me, about that time in 1921, when we were lost for three months in the northern Adirondack Mountains, in the dead of winter...” Young Lizzy Allison and her brother Timothy are left frightened and alone when their father dies in the frozen Adirondacks. Battling the untamed perils of nature, withstanding the fierce and bitter elements, and confronting the deadly instincts of man, two desperate children embark on a heart-stopping journey of courage, strength, and endurance against all odds.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=uaMcACm28QsC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","1976-07-01","Penguin","1976-01-01","A Novel"))